ariable volume_range `fig_volume.y_range`.\n     */\n    \"use strict\";\n\n    let i = Math.max(Math.floor(cb_obj.start), 0),\n        j = Math.min(Math.ceil(cb_obj.end), source.data['ohlc_high'].length);\n\n    let max = Math.max.apply(null, source.data['ohlc_high'].slice(i, j)),\n        min = Math.min.apply(null, source.data['ohlc_low'].slice(i, j));\n    _bt_scale_range(ohlc_range, min, max, true);\n\n    if (volume_range) {\n        max = Math.max.apply(null, source.data['Volume'].slice(i, j));\n        _bt_scale_range(volume_range, 0, max * 1.03, false);\n    }\n\n}, 50);\n"},"id":"3097346","type":"CustomJS"},{"attributes":{"toolbar":{"id":"3097418"}},"id":"3097419","type":"ToolbarBox"},{"attributes":{"active_drag":{"id":"3096991"},"active_scroll":{"id":"3096992"},"tools":[{"id":"3096991"},{"id":"3096992"},{"id":"3096993"},{"id":"3096994"},{"id":"3096995"},{"id":"3096996"},{"id":"3096997"},{"id":"3097020"},{"id":"3097347"}]},"id":"3096999","type":"Toolbar"},{"attributes":{"coordinates":null,"data_source":{"id":"3096967"},"glyph":{"id":"3097325"},"group":null,"hover_glyph":null,"muted_glyph":{"id":"3097327"},"nonselection_glyph":{"id":"3097326"},"view":{"id":"3097329"}},"id":"3097328","type":"GlyphRenderer"},{"attributes":{"active_drag":{"id":"3097188"},"active_scroll":{"id":"3097189"},"tools":[{"id":"3097188"},{"id":"3097189"},{"id":"3097190"},{"id":"3097191"},{"id":"3097192"},{"id":"3097193"},{"id":"3097194"},{"id":"3097211"},{"id":"3097347"}]},"id":"3097196","type":"Toolbar"},{"attributes":{"fill_alpha":{"value":0.2},"fill_color":{"value":"cyan"},"hatch_alpha":{"value":0.2},"hatch_color":{"value":"cyan"},"line_alpha":{"value":0.2},"line_color":{"value":"cyan"},"size":{"value":8},"x":{"value":17},"y":{"value":1.01548320822}},"id":"3097027","type":"Scatter"},{"attributes":{"active_drag":{"id":"3096951"},"active_scroll":{"id":"3096952"},"tools":[{"id":"3096951"},{"id":"3096952"},{"id":"3096953"},{"id":"3096954"},{"id":"3096955"},{"id":"3096956"},{"id":"3096957
